import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="form-group">
          <label htmlFor="formGroupExampleInput">Default input</label>
          <input
            type="text"
            className="form-control"
            id="formGroupExampleInput"
          />
        </div>
      </header>
    </div>
  );
}

export default App;
